import logo from './logo.svg';
import './App.css';
import BarraNavegacion from './components/BarraNavegacion/BarraNavegacion';
import CarritoComponents from './components/CarritoComponents/CarritoComponents';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="" className="App-logo" alt="logo" />
        <BarraNavegacion />
        <CarritoComponents />
      </header>
    </div>
  );
  return (
    <div>
      <main>
        <section>
          <div>
            <p></p>
          </div>
        </section>
      </main>
    </div>
  );
}

export default App;
